  false,\n\t\"url\": null,\n\t\"notes\": \"The report, **Biomass as Feedstock for
  a Bioenergy and Bioproducts Industry: The Technical Feasibility of a Billion-Ton
  Annual Supply** (generally referred to as the Billion-Ton Study or 2005 BTS), was
  an estimate of potential biomass available within the contiguous United States based
  on assumptions about current and future inventory production capacity, availability,
  and technology. This follow-up report, **U.S. Billion-Ton Update: Biomass Supply
  for a Bioenergy and Bioproducts Industry** (generally referred to as the 2011 BT2),
  expands on the 2005 BTS to include:  - A spatial, county-by-county inventory of
  potentially available primary feedstocks - Price and available quantities (e.g.,
  supply curves) for the individual feedstocks - A more rigorous treatment and modeling
  of resource sustainability.\",\n\t\"license_title\": \"Other (Not Open)\",\n\t\"extras\":
